const express = require('express');
const app = express();
app.listen(3000);

const cors = require('cors');
let corsOptions = {
    origin: "*" //pour que toute les requtes soient acceptes, ("*" uniquement pour le dev sinon mettre une URL)
}
app.use(cors(corsOptions));

//PASSAGE D'UNE ROUTE SANS PARAMETRE
app.get('/users', function (req, res) {
    console.log("/users");
    res.send(users);
});

app.get('/events', function (req, res) {
    console.log("/events");
    res.send(events);
});

//PASSAGE D'UNE ROUTE AVEC UN PARAMETRE
app.get('/users/:id', function (req, res) {
    let id = req.params.id; //On rcupre le paramtre pass en bout de route (l'id)
    console.log("id:" + id);
    //On cherche un joueur ayant cet id
    for (let i = 0; i < users.length; i++) {
        let currentUser = users[i];
        if (currentUser.id == id) { //Si on a trouv un joueur ayant l'id demand
            res.send(currentUser); //On rpond  la requte en retournant le joueur (et le code de status 200 envoy par dfaut)
            break; //On quitte la fonction 
        }
    }

    //Si on n'a pas trouv de joueur avec l'id demand :
    res.statusMessage = "Player not found"; //On prpare un message d'erreur
    res.status(404).end(); //On rpond avec une erreur 404 et le message d'erreur
});
